import React, {usestate} from 'react';

const searchBar = () => {

    const [searchInput, setSearchInput] = usestate("")

    const handleChange = (e) => {
        e.preventDefault();
        setSearchInput(e.target.value);
    };
return(
    <div>
        <input 
            type="text"
            placeholder="Search here"
            onChange={handleChange}
            value={searchInput}

        />
    </div>
)
};

export default searchBar;
